import React, { Component } from 'react'
import { connect } from 'http2';

class home_container extends Component {
  render() {
    return (
      <div>
        Homw
      </div>
    )
  }
}

function  mapStateToProps  (state) {
    return {
        books: state.books
    }
}
export default connect(mapStateToProps)(Home_container);
